Actionscript.script:
onClipEvent (load) {
	if (_parent._parent._parent.脸型 != undefined)
	{
		this.基本款._visible = 0;
		var 脸型 = this.attachMovie(_parent._parent._parent.脸型, "装扮", this.getNextHighestDepth());
		脸型.gotoAndStop(this.基本款._currentframe);
	}
	this.attachMovie(_parent._parent._parent.发型,"装扮2",this.getNextHighestDepth());
	this.attachMovie(_parent._parent._parent.面具,"装扮3",this.getNextHighestDepth());
}
